/** @format */

import React from "react";

import { useSelector } from "react-redux";
import { selectIsSignIn } from "../../slices/authenticate.slice";
import { Container, Card, Image, CardColumns } from "react-bootstrap";
import SignIn from "../sign-in/sign-in.component";
import SignUp from "../sign-up/sign-up.component";

const Authenticate = () => {
  const isSignIn = useSelector(selectIsSignIn);
  return (
    <Container
      style={{
        marginTop: "175px",
      }}
    >


      <CardColumns>
      <Card>
        <Card.Img
          variant="top"
          src="https://images.unsplash.com/photo-1482049016688-2d3e1b311543?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=3353&q=80"
        />
      </Card>

        {isSignIn ? <SignIn /> : <SignUp />}
      </CardColumns>
    </Container>
  );
};

export default Authenticate;
